import * as echarts from "echarts";
import ReactEcharts from "echarts-for-react";
import React from "react";
import {
  Spin,
  Row,
  Col,
  Radio,
  Card,
  DatePicker,
  Button,
  Select,
  Input,
  Icon,
} from "antd";
import * as URI from "../../../core/constants/RESTURI";
import * as AjaxUtils from "../../../core/utils/AjaxUtils";
import "../css/index.less";

const dataUrl = URI.ETL.RELATIONSHIP.metaLink;

//元数据库表的血缘关系

class MetaRelationShip extends React.Component {
  constructor(props) {
    super(props);
    this.tableName = this.props.tableName;
    this.widthPercent = window.screen.width / 920;
    this.heightPercent = window.screen.height / 1080;
    this.picBasePic = [
      "image://data:image/png;base64,",

      "image://data:image/png;base64,",

      "image://data:image/png;base64,",

      "image://data:image/png;base64,",
    ];
    this.picClickBasePic = [
      "image://data:image/png;base64,",

      "image://data:image/png;base64,",

      "image://data:image/png;base64,",

      "image://data:data:image/png;base64,",
    ];
    this.color = ["#00beff", "#3928ff", "#8b00f0", "#ff259a"];
    this.levelNode = []; /* 每一层的节点 */
    this.countLevelPer = 0;
    this.state = {
      mask: false,
      option: {},
      nodeMessage: {},
      height: 570,
    };
  }

  componentDidMount() {
    this.loadData();
  }

  loadData = () => {
    this.setState({ mask: true });
    let url = dataUrl + "?tableName=" + this.tableName;
    AjaxUtils.get(url, (data) => {
      if (data.state === false) {
        AjaxUtils.showError(data.msg);
      } else {
        let nodeMessage = {};
        if (data && data.nodes[0]) {
          const item = data.nodes.find((item) => item.itemStyle);
          nodeMessage = {
            ...item,
            textColor: this.color[this.getStyleIndex(item.level, 4)],
          };
        }
        this.setState({ mask: false, nodeMessage: nodeMessage }, () => {
          this.initChart(data);
        });
      }
    });
  };

  getLevelArr = (node = []) => {
    const data = [];
    node.forEach((item) => {
      const index = Number(item.level) - 1;
      if (!data[index]) {
        data[index] = [];
        data[index].push(item.name);
      } else {
        data[index].push(item.name);
      }
    });
    this.levelNode = data;
    this.getCountLevelPer();
  };

  getCountLevelPer = (arr = []) => {
    let count = 0;
    this.levelNode.forEach((item) => {
      if (item.length > count) {
        count = item.length;
      }
    });
    this.countLevelPer = count;
  };

  getLineColor = (str) => {
    let colorIndex = 0;
    this.levelNode.forEach((item, index) => {
      if (item.includes(str)) {
        colorIndex = index;
      }
    });
    return this.getStyleIndex(colorIndex + 1);
  };

  getStyleIndex = (level, count = 4) => {
    let styleIndex = Number(level) % Number(count);
    if (styleIndex === 0) {
      styleIndex = 3;
    } else {
      styleIndex -= 1;
    }
    return styleIndex;
  };

  formatterRemark = (params) => {
    let str = "";
    if (params.data.remark.length > 7) {
      str = `${params.data.remark.slice(0, 7)}\n${params.data.remark.slice(7)}`;
    } else {
      str = params.data.remark;
    }
    return str;
  };

  formatterName = (params) => {
    let str = "";
    if (params.data.modelName.length > 12) {
      str = `${params.data.modelName.slice(
        0,
        12
      )}\n${params.data.modelName.slice(12)}`;
    } else {
      str = params.data.modelName;
    }
    return str;
  };

  initChart = (data) => {
    this.getLevelArr(data.nodes);
    data.links.forEach((item, i) => {
      let colorIndex = this.getLineColor(item.source);
      if (item.remark !== "" && item.remark != undefined) {
        item.label = {
          show: true,
          fontSize: 12,
          color: "#666666",
          remark: item.remark,
          formatter: this.formatterRemark,
        };
      }
      item.lineStyle = {
        color: this.color[colorIndex],
      };
    });
    data.nodes.forEach((item) => {
      /*有itemStyle这个字段说明是源点  */
      const styleIndex = this.getStyleIndex(item.level, 4);
      if (item.itemStyle) {
        item.symbol = this.picClickBasePic[styleIndex];
        item.symbolSize = [120, 120];
      } else {
        item.symbol = this.picBasePic[styleIndex];
      }
      item.textColor = this.color[styleIndex]; /**/
      item.label = {
        color: this.color[styleIndex],
        formatter: this.formatterName,
      };
      item.itemStyle = {
        normal: {
          color: this.color[styleIndex],
        },
      };
    });

    let option = (option = {
      /* title: {text: this.tableName+'的血缘关系',top: 'top',left: 'left'}, */
      legend: [],
      color: this.color, 
      series: [
        {
          type: "graph",
					top:30,
          //layout : 'force', 图的布局，类型为力导图，'circular' 采用环形布局，见示例 Les Miserables
          legendHoverLink: true, //是否启用图例 hover(悬停) 时的联动高亮。/* */
          hoverAnimation: true, //是否开启鼠标悬停节点的显示动画
          coordinateSystem: null, //坐标系可选
          /* xAxisIndex : 0, //x轴坐标 有多种坐标系轴坐标选项 */
          symbolSize: [100, 100], //图形大小
          symbolOffset: [-25, 0] /**/,
          layout: "none",
          roam: true,
          categories: "categories",
          /* focusNodeAdjacency: true, */
          label: {
            position: "bottom",
            formatter: "{b}",
            show: true,
            offset: [0, -15],
          },
          /* edgeLength: */
          edgeSymbol: ["none", "arrow"],
          edgeSymbolSize: [4, 10],
          edgeLabel: {
            fontSize: 20,
          },
          itemStyle: {
            color: "#CCFFFF",
            borderColor: "#666",
            borderWidth: 0.5,
            borderType: "solid",
          },
          lineStyle: {
            opacity: 0.9,
            width: 2,
            curveness: 0,
          },
          data: data.nodes,
          links: data.links,
        },
      ],
    });
    this.setState({ option: option, height: this.countLevelPer*200 });
  };

  onEvent = {
    /* 'click': this.clickEchartsPie.bind(this), */
    mouseover: this.mouseoverEchartsPie.bind(this),
    mouseout: this.mouseoutEchartsPie.bind(this),
  };
  clickEchartsPie(e) {
    const optionData = JSON.parse(JSON.stringify(this.state.option));
    const newNodeList = optionData.series[0].data;
    const newlinkList = optionData.series[0].links;
    newNodeList.forEach((item) => {
      item.label = {
        ...item.label,
        formatter: this.formatterName,
      };
      const styleIndex = this.getStyleIndex(item.level, 4);
      if (item.name === e.data.name) {
        item.symbol = this.picClickBasePic[styleIndex];
      } else {
        item.symbol = this.picBasePic[styleIndex];
      }
    });
    newlinkList.forEach((item) => {
      item.label = { ...item.label, formatter: this.formatterRemark };
    });
    this.setState({
      nodeMessage: e.data,
      option: optionData,
    });
  }
  mouseoverEchartsPie(e) {
    if (e.dataType === "node") {
      /* 是节点才给事件 */
      const optionData = JSON.parse(JSON.stringify(this.state.option));
      const newNodeList = optionData.series[0].data;
      const newlinkList = optionData.series[0].links;
      newNodeList.forEach((item) => {
        item.label.formatter = this.formatterName;
        if (item.name === e.data.name) {
          item.label = {
            ...item.label,
            fontSize: 16,
          };
        }
      });
      newlinkList.forEach((item) => {
        item.label = {
          ...item.label,
          formatter: this.formatterRemark,
        };
      });
      this.setState({
        option: optionData,
        nodeMessage: e.data,
      });
    }
  }
  mouseoutEchartsPie(e) {
    const optionData = JSON.parse(JSON.stringify(this.state.option));
    const newNodeList = optionData.series[0].data;
    const newlinkList = optionData.series[0].links;
    newNodeList.forEach((item) => {
      item.label = {
        ...item.label,
        fontSize: 12,
        formatter: this.formatterName,
      };
    });
    newlinkList.forEach((item) => {
      item.label = { ...item.label, formatter: this.formatterRemark };
    });
    this.setState({
      option: optionData,
    });
  }

  render() {
    const { nodeMessage } = this.state;
    return (
      <Spin spinning={this.state.mask} tip="Loading...">
        <div className="metaRelationShip">
          <div style={{ width: "80%", paddingLeft: 20 }}>
            <div className="metaRelationShip-chart">
              <ReactEcharts
                option={this.state.option}
                style={{ height: this.state.height}}
                className="react_for_echarts"
                ref={(node) => {
                  this.echartspie = node;
                }}
                onEvents={this.onEvent}
              />
            </div>
          </div>

          <div style={{ width: "20%", marginBottom: 10 }}>
            <div className="metaRelationShip-message">
              <div className="ods-ms-evi-all-machine-df">
                <div className="text-style-1">所属任务:</div>
                <div
                  className="text-style-2"
                  style={{ color: `${nodeMessage.textColor || "#000"}` }}
                >
                  {nodeMessage.processName}
                </div>
              </div>
              <div className="split_line"></div>
              <div className="metaRelationShip-dec">
                <div className="metaRelationShip-dec-item">
                  <div className="metaRelationShip-dec-item-name">
                    数据源ID:{" "}
                  </div>
                  <div
                    className="metaRelationShip-dec-item-data"
                    title={nodeMessage.dataSourceId}
                  >
                    {nodeMessage.dataSourceId}
                  </div>
                </div>
                <div className="metaRelationShip-dec-item">
                  <div className="metaRelationShip-dec-item-name">表名:</div>
                  <div
                    className="metaRelationShip-dec-item-data"
                    title={nodeMessage.name}
                  >
                    {nodeMessage.name}
                  </div>
                </div>
                <div className="metaRelationShip-dec-item">
                  <div className="metaRelationShip-dec-item-name">负责人:</div>
                  <div
                    className="metaRelationShip-dec-item-data"
                    title={nodeMessage.creator}
                  >
                    {nodeMessage.creator}
                  </div>
                </div>
                <div className="metaRelationShip-dec-item">
                  <div className="metaRelationShip-dec-item-name">备注:</div>
                  <div
                    className="metaRelationShip-dec-item-data"
                    title={nodeMessage.remark}
                  >
                    {nodeMessage.remark ? nodeMessage.remark : ""}
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </Spin>
    );
  }
}

export default MetaRelationShip;
